//     }

export default function FormDialog({fields } ) {
  const [open, setOpen] = React.useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };
  const handleSumbit = event => {
    console.log("in handle submit\n");
    console.log(localStorage.getItem('myItem'));
    
  };
  const handleInputChange = event => {
    // console.log('Click');
    console.log(event.target.value);
    console.log(event.target);
    const value = event.target.value;
    localStorage.setItem('myItem', value);
  };

  return (
    <div>
      <Button variant="outlined" onClick={handleClickOpen}>
        Open form dialog
      </Button>
      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>Subscribe</DialogTitle>
        <DialogContent>
          <DialogContentText>
            To subscribe to this website, please enter your email address here. We
            will send updates occasionally.
          </DialogContentText>
          {/* (store_id, quantity,name, price, category, key_words) */}
          {fields.map((field) => (
                               <TextField
                               autoFocus
                               margin="dense"
                               id="name"
                               label={field}
                               type="storeid"
                               fullWidth
                               variant="standard"
                               onChange={handleInputChange}
                             />
                                ))}
          
             
          
          
          
        </DialogContent>
        
        <DialogActions>
          <Button onClick={handleClose}>Cancel</Button>
          <Button onClick={handleSumbit}>Subscribe</Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
